def ver_pelicula(load):

    def hide():

        title.grid_forget()
        Label_img.grid_forget()
        Label1.grid_forget()
        Label2.grid_forget()
        Label3.grid_forget()
        Label4.grid_forget()
        Label5.grid_forget()
        Button1.grid_forget()
        Button2.grid_forget()
        Button3.grid_forget()
    
    
    def visualizar():
        if scroll.get() == 0:
            cap = list_movie[0] 
        else:
            cap = list_movie[scroll.get()]
        hide()
        ret, frame = cap.read()
        if ret == True:
            frame = imutils.resize (frame, width = 1500)
            frame = cv2.cvtColor (frame, cv2.COLOR_BGR2RGB)

            im = Image.fromarray(frame)
            img = ImageTk.PhotoImage(image =im)

            LblVideo.configure(image = img)
            LblVideo.image = img
            LblVideo.after(10,visualizar)

    ventana_ver = tk.Toplevel() 
    ventana_ver.title('VER PELICULAS')
    ventana_ver.iconbitmap('BASE_PELICULAS/LOGO.ico')
    title = tk.Label(ventana_ver,text='PELICULAS',font='DOVENS 30 bold')
    title.grid(columnspan=5,column=2,pady=10,padx=10)
    

    num = 0  
    def botomIz():
        if scroll.get() >0:
            scroll.set(scroll.get()-1)
            moviee.set(load[scroll.get()]['Nombre'].replace('_',' '))
            gener.set(load[scroll.get()]['Genero'].replace('_',' '))
            time.set(load[scroll.get()]['Duracion'].replace('_',' '))
            estreno.set(load[scroll.get()]['Estreno'].replace('_',' '))
            director.set(load[scroll.get()]['Director'].replace('_',' '))
