        scroll = tk.IntVar()
        scroll.set(0)
        moviee = tk.StringVar(ventana_mp)
        moviee.set(load[scroll.get()]['Nombre'].replace('_',' '))

        im = ImageTk.PhotoImage(file='BASE_PELICULAS/IM.jpg')

