def load():

    #Abrimos la ruta donde esta, lo abriremos en modo de lectura de bytes
    data_base = open('BASE_DATOS.bin','rb')

    stg_m = {}
    storage_movies = []
    n=0    

    #Contexto, mis datos se guardan así
    #Nombre: BOB_ESPONJA Genero: AVENTURA, et (CADA RENGLON ES UN DICCIONARIO DIFERENTE, POR ENDE ES UNA PELICULA DIFERENTE)
    #ejecute la subfuncion readlines para que cada RENGLON
    data_search = data_base.readlines()
    #Este for tiene un len para que cuente cuantas listas se generaron y así descodifique TODAS, así ya todas estaran en cadena
    for i in range(len(data_search)):
        #La iterable muestra el numero de la lista que hay, por ende abarcara todas (ni mas ni menos)
        data_search[i] = data_search[i].decode()

    #Otro for para que por cada lista la separe por segmentos: [Nombre:BOB_ESPONJA,Genero:AVENTURA]
    for i in range(len(data_search)):
        data_search_2 = data_search[n].split()
        n+=1
        f=0

        for e in ('Nombre','Genero','Duracion','Estreno','Director'):
            stg_m[e] = data_search_2[f]
            f+=1

        storage_movies.append(stg_m)
        stg_m = {}

    data_base.close()
    return storage_movies

